// Configuration for your app
const config = {
    // ⭐ YOUR API GATEWAY ENDPOINT ⭐
    API_ENDPOINT: "https://ke3a91dqwe.execute-api.ap-south-1.amazonaws.com/prod/optimize",
    
    // ⭐ YOUR S3 BUCKET FOR UPLOADS ⭐
    S3_BUCKET: "image-optimization-uploads",
    S3_REGION: "ap-south-1",
    
    // App settings
    MAX_FILE_SIZE: 10 * 1024 * 1024, // 10MB
    SUPPORTED_FORMATS: ['image/jpeg', 'image/jpg', 'image/png', 'image/webp', 'image/gif'],
    DEFAULT_WIDTH: 800,
    DEFAULT_QUALITY: 85
};

export default config;
